import React, {
	Component
} from 'react';
import Navigation from '../../components/Navigation/Navigation';
import Sidebar from '../../components/Sidebar/Sidebar';
import PortfolioListItems from '../../components/PortfolioListItems/PortfolioListItems';

import bg1 from './../../assets/img/agnes-bg.jpg';
import bg2 from './../../assets/img/wejsciowka-bg.jpg';
import bg3 from './../../assets/img/wa-bg.jpg';

class PortfolioView extends Component {
	state = {
		PortfolioItems: [{
				id: 1,
				name: 'Agnes | Aplikacja mobilna + strona www',
				link: 'http://agnes-painkiller.com',
				backgroundImageURL: bg1
			},
			{
				id: 2,
				name: 'Wejściówka mobile app',
				link: 'www.google.pl',
				backgroundImageURL: bg2
			},
			{
				id: 3,
				name: 'What About - webdesign',
				link: 'www.google.pl',
				backgroundImageURL: bg3
			}
		],
		Offset: [{
			initOffset: 0
		}]
	};
	render() {
		return ( <
			div className = "wrapper portfolio-wrapper h-100" >
			<
			Navigation / >
			<
			Sidebar / >
			<
			PortfolioListItems items = {
				this.state.PortfolioItems
			}
			/>{' '} < /
			div >
		);
	}
}

export default PortfolioView;
